import React from "react";

const ProfileStatus = (props) => {
  return (
    <div>
    <div>
        <span>{props.status}</span>
    </div>
    <div>
        <input>{props.profileStatus}</input>
    </div>
    </div>
  )
};

export default ProfileStatus
